import React from 'react'
import '../App.css'
import { NavLink } from 'react-router-dom';


export default function Nav() {
    return (
        <div>
        <nav>
        <ul>
          <li><NavLink to='/'>Home</NavLink></li>
          <li><NavLink to='/add'>Add a Restaurant</NavLink></li>
        </ul>
      </nav>    
        </div>
    )
}
